import './Contact.css';

function Contact() {
  return (
    <div className="Contact">
        <div id="contact-links">
          <a href="mailto:camiillee.ag@gmail.com" class="email-link">Gmail</a>
          <a href="https://www.linkedin.com/in/camillegandotra/" class="email-link" target="_blank">LinkedIn</a>
        </div>
    </div>
  );
}

export default Contact;
